import appleImg from './apple.png';
import store from './mobx/index'
import './App.css';
console.log(store.apples)
function ProList() {

}
function App() {
  return (
    <div className="App">
      <header className="App-header">
        苹果篮子
      </header>
      {/* 合计数量重量 */}
      <div className='countBox'>
        <div className='left-count'>
          <div className='label'>当前</div>
          <div><span>1</span>个苹果，224克</div>
        </div>
        <div className='right-count'>
          <div className='label'>已吃掉</div>
        </div>
      </div>
      {/* 商品列表 */}
      <div className='proList'>
        <img src={appleImg} alt='商品图片'></img>
        <div>
          <div>
          <span className='proName'>红苹果 _ 1 号</span>
          </div>
          <div>
            200克
          </div>
        </div>
        <button>吃掉</button>
      </div>
      <button className='addBtn'>摘苹果</button>
    </div>
  );
}

export default App;
